INSERT INTO `wp_5ebx60yrn8_posts` VALUES (112,1,'2020-04-19 19:59:52','2020-04-19 19:59:52','OG was created as the new team of former (monkey) Business players. The team\'s breakthrough came at the Frankfurt Major in late November, 2015. They fought through the lower bracket, defeating TI5 champions Evil Geniuses and runner-ups CDEC Gaming. By winning the 2017 Kiev Major, OG became the first team in Dota 2 history to win four Dota Major Championships. In August 2018, OG became the first team to win The International from the open qualifiers. The grand finals of the event were the subject of a 2018 episode of \"True Sight\", making OG the only team to be featured in the series more than once. In August 2019, OG became the first team to win more than one TI by winning TI9, also becoming the first back-to-back TI winners in the history of the game.','OG','','publish','closed','closed','','og','','','2020-04-21 21:12:26','2020-04-21 21:12:26','',0,'http://esports-news1.local/?post_type=team&#038;p=112',0,'team','',0);
INSERT INTO `wp_5ebx60yrn8_posts` VALUES (113,1,'2020-04-19 20:00:07','2020-04-19 20:00:07','Evil Geniuses, often abbreviated as EG, is one of the oldest North American professional gaming organisations. Founded in 1999, EG is known to have highly successful players in every competitive game they feature and is considered by many to be one of the most premier gaming organisations that exist today. EG was previously a member of the G7 Teams association.','EG','','publish','closed','closed','','eg','','','2020-04-21 21:12:03','2020-04-21 21:12:03','',0,'http://esports-news1.local/?post_type=team&#038;p=113',0,'team','',0);
