INSERT INTO `wp_5ebx60yrn8_posts` VALUES (174,1,'2020-04-21 18:40:11','2020-04-21 18:40:11','Complexity Gaming, formerly stylized as compLexity Gaming abbreviated as COL, is one of the most long-standing and respected eSports teams in North America. The organization, founded in 2003 by Jason \"1\" Lake, has a long history of championship caliber teams in many different games. They currently field teams for League of Legends, Dota 2, Hearthstone and StarCraft II.\r\nOn September 11th 2014, Complexity announced the beginnings of their Hearthstone division with the signing of NA Ladder Legend Dog.','Complexity Gaming','','publish','closed','closed','','complexity-gaming','','','2020-04-21 21:11:11','2020-04-21 21:11:11','',0,'http://esports-news1.local/?post_type=team&#038;p=174',0,'team','',0);
