INSERT INTO `wp_5ebx60yrn8_posts` VALUES (230,1,'2020-04-21 20:44:40','2020-04-21 20:44:40','Fnatic, occasionally stylized as fnatic and abbreviated as FNC, is a professional gaming organization with registered offices in the United Kingdom, Australia and the Netherlands. Fnatic is considered as a European team. Founded by Sam Mathews with Joris Van Laerhoven and Anne Mathews in 2004, and mainly operating out of their London offices, Fnatic has fielded numerous well known professional gamers in a variety of esports titles, in particular their Scandinavian Counter-Strike Global Offensive team as well as VoO in Painkiller. Fnatic has won the ESPORTS Team of the Year Award in 2006 and 2009. During 2007-2008 Fnatic welcomed Neil Kirk (co-founder TCM Gaming). After playing several years for Fnatic, Patrik \"cArn\" Sättermon, one of the best CS:1.6 players became the Chief Gaming Officer of Fnatic in 2012. Since 2013, Anne Mathews took over the position of Sam Mathews as the CEO of Fnatic. Sam Mathews still remains as a Chairman in the organisation.','Fnatic','','publish','closed','closed','','fnatic','','','2020-04-21 23:24:36','2020-04-21 23:24:36','',0,'http://esports-news1.local/?post_type=team&#038;p=230',0,'team','',0);
