INSERT INTO `wp_5ebx60yrn8_posts` VALUES (242,1,'2020-04-21 20:47:07','2020-04-21 20:47:07','Team Liquid is a professional team, founded in the Netherlands in 2000. Originally a Brood War clan, the team switched to SC2 during the SC2 Beta in 2010, and became one of the most successful foreign teams. In January 2015 it was announced that Team Curse and Team Liquid were merging their assets and Team Liquid would become the new name for any of Curses contracted players or teams.\r\nTeam Liquid is also strongly associated with its website, TeamLiquid.net. Launched on May 1, 2001, it has developed through the years into a focal point for StarCraft and Dota 2 coverage, eventually became the most-browsed StarCraft-related website in the world, gathering thousands of members (including several professional players) and centralizing news about the global SC2 scene. The website also features a progaming database, the TLPD, as well as a wiki dedicated to Brood War, StarCraft II, Hearthstone, Dota 2, Super Smash Brothers: Melee, Heroes of the Storm and Overwatch, Liquipedia.','Team Liquid','','publish','closed','closed','','team-liquid','','','2020-04-21 23:24:32','2020-04-21 23:24:32','',0,'http://esports-news1.local/?post_type=team&#038;p=242',0,'team','',0);
