INSERT INTO `wp_5ebx60yrn8_posts` VALUES (296,1,'2020-04-23 02:30:05','2020-04-23 02:30:05','<!-- wp:paragraph -->\n<p>It’s been six long years since Cloud9’s&nbsp;<em>League</em>&nbsp;roster won a championship. Yes, they’ve still been very successful—especially with the numerous deep runs they’ve had in Worlds—but in the end, they haven’t won anything to put in their trophy case since 2014.</p>\n<!-- /wp:paragraph -->','C9 dominates LCS','','inherit','closed','closed','','276-revision-v1','','','2020-04-23 02:30:05','2020-04-23 02:30:05','',276,'http://esports-news1.local/276-revision-v1/',0,'revision','',0);
INSERT INTO `wp_5ebx60yrn8_posts` VALUES (297,1,'2020-04-23 02:30:15','2020-04-23 02:30:15','<!-- wp:paragraph -->\n<p><em>Call of Duty: Mobile</em>&nbsp;has quickly grown to become one of the biggest games in the world, and soon it will have a competitive tournament to match. Today, Activision revealed the&nbsp;<em>Call of Duty: Mobile</em>&nbsp;World Championship 2020 Tournament, a lengthy esports tournament that features more than $1 million in total prizes, which include both cash and in-game cosmetics.</p>\n<!-- /wp:paragraph -->','Call of Duty: Mobile 1 Mil Prize','','inherit','closed','closed','','263-revision-v1','','','2020-04-23 02:30:15','2020-04-23 02:30:15','',263,'http://esports-news1.local/263-revision-v1/',0,'revision','',0);
